import logo from './logo.svg';
import './App.css';
import Hello from './Hello.js';
import logo_pizza from './img/logoPizza.png';
import Contact from "./Contact.js"
import "./Home.js"
import "./Menu.js"

function App() {
      return (
            <nav>
            <Router>
            <div className="nav-wrapper">
                  <img src={logo_pizza} height="60" width="60"></img>
                  <ul className="right hide-on-med-and-down">
                        <li><a href="sass.html"><i className="material-icons">home</i></a></li>
                        <li><a href="badges.html"><i className="material-icons">menu</i></a></li>
                        <li><a href="collapsible.html"><i className="material-icons">contact</i></a></li>
                  </ul>
            </div>
            <Hello/>
            </Router>
            </nav>
      );
}

export default App;
